import React, { useEffect, useState } from 'react';
import axios from 'axios';

const GitHubRepoList = () => {
  const [repos, setRepos] = useState([]);

  useEffect(() => {
    axios.get('https://api.github.com/users/d-lil/repos')
      .then(response => {
        setRepos(response.data);
      })
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>GitHub Repositories</h2>
      <div>
        {repos.map(repo => (
          <div key={repo.id} style={{ margin: '10px 0', padding: '10px', border: '1px solid #ddd' }}>
            <h3>{repo.name}</h3>
            <p>{repo.description}</p>
            <div>Stars: {repo.stargazers_count}</div>
            <div>Forks: {repo.forks_count}</div>
            <div>Primary Language: {repo.language}</div>
            <a href={repo.html_url} target="_blank" rel="noopener noreferrer">View on GitHub</a>
          </div>
        ))}
      </div>
    </div>
  );
};


function Github({ src, height, width }) {
  return (
    <div>
      <GitHubRepoList />
    </div>
  );
}

export default Github;
